using System;
using System.Collections;
using System.Collections.Generic;
using System.Runtime.InteropServices;
using Newtonsoft.Json;
using UnityEngine;

public class WebCommunication : SingletonMono<WebCommunication>
{
#if UNITY_WEBGL && !UNITY_EDITOR
    [DllImport("__Internal")]
    private static extern void JSInit();

    [DllImport("__Internal")]
    private static extern void JSLibRequestDataFromFacebook();

    [DllImport("__Internal")]
    private static extern void JSLibWriteUserData(string str);

    [DllImport("__Internal")]
    private static extern void JSLibWriteStringCache(string str);

    [DllImport("__Internal")]
    private static extern void JSCreateShortcut();

    [DllImport("__Internal")]
    private static extern bool JSCanCreateShortcut();

    [DllImport("__Internal")]
    private static extern string JSLibFacebookName();

    [DllImport("__Internal")]
    private static extern void JSClearData();

    [DllImport("__Internal")]
    private static extern bool JSIsMobile();

    [DllImport("__Internal")]
    private static extern void JSLog(string str);

    [DllImport("__Internal")]
    private static extern void JSPreloadFacebookInstantInterstitialAds(string key);

    [DllImport("__Internal")]
    private static extern void JSShowFacebookInstantInterstitial();

    [DllImport("__Internal")]
    private static extern void JSShowFacebookInstantRewardedVideo(string key);

    [DllImport("__Internal")]
    private static extern void JSLoadFacebookInstantBannerAds(string key);

    [DllImport("__Internal")]
    private static extern void JSHideFacebookInstantBannerAds();

    [DllImport("__Internal")]
    private static extern bool JSCanInviteFriend();

    [DllImport("__Internal")]
    private static extern void JSFacebookInstantInviteFriend(string imagebase64);

    [DllImport("__Internal")]
    private static extern void JSSubcribeBot();
#else
    private void JSInit() { }
    private void JSLibRequestDataFromFacebook()
    {

        OnStringCacheResponse(PlayerPrefs.GetString("JSLibWriteStringCache", ""));
        OnUserDataResponse(PlayerPrefs.GetString("JSLibWriteUserData", ""));
    }
    private void JSLibWriteUserData(string str)
    {
        PlayerPrefs.SetString("JSLibWriteUserData", str);
        PlayerPrefs.Save();
    }
    private void JSLibWriteStringCache(string str)
    {
        PlayerPrefs.SetString("JSLibWriteStringCache", str);
        PlayerPrefs.Save();
    }
    private void JSCreateShortcut()
    {
        OnShortcutCreated();
    }
    private bool JSCanCreateShortcut() { return false; }
    private string JSLibFacebookName() { return "FbInst Editor"; }
    private void JSClearData()
    {
        PlayerPrefs.DeleteAll();
    }
    private bool JSIsMobile() { return false; }
    private void JSLog(string str) { Debug.Log(str); }
    private void JSPreloadFacebookInstantInterstitialAds(string key) { }
    private void JSShowFacebookInstantInterstitial() { }
    private void JSShowFacebookInstantRewardedVideo(string key) { }
    private void JSLoadFacebookInstantBannerAds(string key) { }
    private void JSHideFacebookInstantBannerAds() { }
    private bool JSCanInviteFriend() { return false; }
    private void JSFacebookInstantInviteFriend(string imagebase64) { OnFacebookInstantInviteFriendFail(); }
    private void JSSubcribeBot() { }
#endif

    private const string InterstitialAdUnitId = "567547264585994_568893241118063";
    private const string RewardedAdUnitId = "567547264585994_568893384451382";
    private const string BannerAdUnitId = "567547264585994_568893041118083";
    private const string imageInviteFriendBase64 = "data:image/png;base64,";

    private Dictionary<string, string> playerPrefs;
    private string userData;

    private bool isLoadDataCompleted;
    private Action onShortcutCreated;
    private Action<bool> onShowInterstitialComplete;
    private Action<bool> onShowVideoAdsComplete;
    private Action<bool> onInviteFriendComplete;

    public IEnumerator LoadData()
    {
        playerPrefs = new Dictionary<string, string>();
        userData = "";

        JSInit();
        JSLibRequestDataFromFacebook();

        //waiting for completed
        var timeOut = 5f;
        var retry = 3;

        while (isLoadDataCompleted == false)
        {
            timeOut -= Time.deltaTime;
            if (timeOut <= 0)
            {
                if (retry <= 0)
                {
                    isLoadDataCompleted = true;
                }
                else
                {
                    JSLibRequestDataFromFacebook();
                    retry -= 1;
                    timeOut = 5f;
                }
            }

            yield return Time.deltaTime;
        }
    }

    public string GetFacebookName()
    {
        return JSLibFacebookName();
    }

    #region Data

    public void OnStringCacheResponse(string jsonStr)
    {
        var dic = JsonConvert.DeserializeObject<Dictionary<string, string>>(jsonStr);
        if (dic != null)
        {
            foreach (var entry in dic)
            {
                AddPlayerPref(entry.Key, entry.Value);
            }
        }
    }

    public void OnUserDataResponse(string json)
    {
        userData = json;
        isLoadDataCompleted = true;
    }

    // Write user data to facebook cloud
    // This function should called when:
    // 1. User unlock something in shop (fish, blade, etc)
    // 2. User finish a game (back to main menu) --- DON'T CALL IT WHEN USER PLAYING
    // 3. Action that update user's virtual currency, items (Ex. coins, gems, ....)
    // 4. Before user close the game (just for sure)
    public void SaveAllData()
    {
        SavePlayerPref();
        SaveUserData();
    }

    public void SaveUserData()
    {
        JSLibWriteUserData(userData);
    }

    public void SavePlayerPref()
    {
        JSLibWriteStringCache(JsonConvert.SerializeObject(playerPrefs));
    }

    public void SetUserData(string value)
    {
        userData = value;
    }

    public string GetUserData()
    {
        return userData;
    }

    public void SetPlayerPrefString(string key, string value)
    {
        AddPlayerPref(key, value);
    }

    public void SetPlayerPrefFloat(string key, float value)
    {
        AddPlayerPref(key, value.ToString());
    }

    public void SetPlayerPrefInt(string key, int value)
    {
        AddPlayerPref(key, value.ToString());
    }

    public string GetPlayerPrefString(string key, string defaultValue = "")
    {
        var v = GetPlayerPref(key);

        if (string.IsNullOrEmpty(v))
        {
            return defaultValue;
        }

        return v;
    }

    public int GetPlayerPrefInt(string key, int defaultValue = 0)
    {
        var v = GetPlayerPref(key);
        int i;

        if (string.IsNullOrEmpty(v) == false && int.TryParse(v, out i))
        {
            return i;
        }

        return defaultValue;
    }

    public float GetPlayerPrefFloat(string key, float defaultValue = 0)
    {
        var v = GetPlayerPref(key);
        float i;

        if (string.IsNullOrEmpty(v) == false && float.TryParse(v, out i))
        {
            return i;
        }

        return defaultValue;
    }

    public void DeletePlayerPrefKey(string key)
    {
        if (playerPrefs.ContainsKey(key))
        {
            playerPrefs.Remove(key);
        }
    }

    public bool HasPlayerPrefKey(string key)
    {
        return playerPrefs.ContainsKey(key);
    }

    private void AddPlayerPref(string key, string value)
    {
        if (playerPrefs.ContainsKey(key))
        {
            playerPrefs.Remove(key);
        }

        playerPrefs.Add(key, value);
    }

    private string GetPlayerPref(string key)
    {
        if (playerPrefs.ContainsKey(key))
        {
            return playerPrefs[key];
        }

        return string.Empty;
    }

    #endregion

    public void CreateShortcut(Action onShortcutCreatedCallback)
    {
        onShortcutCreated = onShortcutCreatedCallback;
        JSCreateShortcut();
    }

    public bool CanCreateShortcut()
    {
        return JSCanCreateShortcut();
    }

    public void OnShortcutCreated()
    {
        onShortcutCreated?.Invoke();
        onShortcutCreated = null;
    }

    public void ClearAllData()
    {
        userData = "";
        playerPrefs.Clear();

        JSClearData();
    }

    public bool IsMobile()
    {
        return JSIsMobile();
    }

    public void Log(string str)
    {
        JSLog(str);
    }

    public void InviteFriend(Action<bool> onInviteFriendCompleteCallback)
    {
        onInviteFriendComplete = onInviteFriendCompleteCallback;
        JSFacebookInstantInviteFriend(imageInviteFriendBase64);
    }

    public bool CanInviteFriend()
    {
        return JSCanInviteFriend();
    }

    public void OnFacebookInstantInviteFriendSuccess()
    {
        onInviteFriendComplete?.Invoke(true);
        onInviteFriendComplete = null;
    }

    public void OnFacebookInstantInviteFriendFail()
    {
        onInviteFriendComplete?.Invoke(false);
        onInviteFriendComplete = null;
    }

    public void SubcribeBot()
    {
        JSSubcribeBot();
    }

    #region ADS

    public void PreloadFacebookInstantInterstitialAds()
    {
        JSPreloadFacebookInstantInterstitialAds(InterstitialAdUnitId);
    }

    public void ShowFacebookInstantInterstitial(Action<bool> onShowInterstitialCompleteCallback)
    {
        onShowInterstitialComplete = onShowInterstitialCompleteCallback;
        JSShowFacebookInstantInterstitial();
    }

    public void OnFacebookInstantInterstitialAdsWatched()
    {
        onShowInterstitialComplete?.Invoke(true);
        onShowInterstitialComplete = null;
    }

    public void OnFacebookInstantInterstitialAdsFail()
    {
        onShowInterstitialComplete?.Invoke(false);
        onShowInterstitialComplete = null;
    }


    public void ShowFacebookInstantRewardedVideo(Action<bool> onShowVideoAdsCompleteCallback)
    {
        onShowVideoAdsComplete = onShowVideoAdsCompleteCallback;
        JSShowFacebookInstantRewardedVideo(RewardedAdUnitId);
    }

    public void OnFacebookInstantRewardVideoWatched()
    {
        onShowVideoAdsComplete?.Invoke(true);
        onShowVideoAdsComplete = null;
    }

    public void OnFacebookInstantRewardVideoFail()
    {
        onShowVideoAdsComplete?.Invoke(false);
        onShowVideoAdsComplete = null;
    }


    public void ShowBannerAds()
    {
        JSLoadFacebookInstantBannerAds(BannerAdUnitId);
    }

    public void HideBannerAds()
    {
        JSHideFacebookInstantBannerAds();
    }

    #endregion
}